import React from "react";
import "../css/Progress.css";

import { IconName } from "react-icons/md";

const Progress = () => {
  return (
    <div className="progress">
      <div className="progress-item">
        <h2>Upload</h2>
      </div>
      <div className="progress-item">
        <h2>Match</h2>
      </div>
      <div className="progress-item">
        <h2>Review</h2>
      </div>
      <div className="progress-item">
        <h2>Complete</h2>
      </div>
    </div>
  );
};

export default Progress;
